INSERT INTO `weixin_newsitem` VALUES ('6', 'news', '新华网', '<div align=\"left\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: 宋体; font-size: 14px; line-height: 25.2000007629395px;\">\n	<p style=\"margin: 12px 0px; padding: 0px;\">\n		　据9月6日报道，有一抢劫犯抢到一女搏击手被打得叫爸爸。事发地在<a href=\"http://news.hexun.com/brazil/\" style=\"margin: 0px; padding: 0px; color: rgb(72, 90, 144);\" target=\"_blank\">巴西</a>，当晚，几名抢劫犯在街上物色作案目标时，看中了一名女子，于是上前将其手机抢走，女子注意到抢走她手机的男子以及其同伙手上并无武器，于是她施展擒拿术，用双腿将男子头部夹住，轻松制服抢劫犯。抢劫犯抢人手机不成，还被打得哭着叫爸爸，让人称快!</p>\n	<p style=\"margin: 12px 0px; padding: 0px;\">\n		　　警方赶到后发现，这名女子是柔道兼混合格斗(MMA)的搏击高手，名叫巴托斯，当时她正与路人走在路上，该名男子抢走了她的手机，当时她马上注意到抢她手机的男子与同伙手上都没有武器，所以她马上以擒拿术将其中一人制服。</p>\n	<p style=\"margin: 12px 0px; padding: 0px;\">\n		　　据悉，该名被制伏的抢劫犯眼睁睁看著同伙逃之夭夭，自己却被巴托斯的双腿嵌住，只能不断的喊：“爸爸!爸爸!快报警啊!老天爷救救我啊!我发誓这是我第一次抢人家东西啦!拜託救救我啊!”</p>\n	<p style=\"margin: 12px 0px; padding: 0px;\">\n		　　警方在约20分钟后赶到现场，并把该名男子带回警局，不过他后来矢口否认犯案，表示自己并不打算抢走巴托斯的手机。女搏击手巴托斯则说，自己其实是救了该名男子一命，因为如果被其他民众以暴制暴，可能早就被打死了。</p>\n</div>\n<div align=\"center\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: 宋体; font-size: 14px; line-height: 25.2000007629395px;\">\n	<div align=\"center\" style=\"margin: 0px; padding: 0px;\">\n		<img align=\"middle\" alt=\"抢到搏击手被打哭\" border=\"1\" src=\"http://i1.hexunimg.cn/2015-09-07/178900939.jpeg\" style=\"margin: 0px; padding: 0px; border: 0px; cursor: pointer;\" width=\"550\" /></div>\n	<div align=\"center\" style=\"margin: 0px; padding: 0px;\">\n		<font style=\"margin: 0px; padding: 0px; font-size: 12px;\">抢到搏击手被打哭</font></div>\n</div>\n<p style=\"margin: 12px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: 宋体; font-size: 14px; line-height: 25.2000007629395px;\">\n	 </p>\n<div align=\"center\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: 宋体; font-size: 14px; line-height: 25.2000007629395px;\">\n	<img align=\"middle\" alt=\"图为制服犯人的女搏击手\" border=\"1\" src=\"http://i7.hexunimg.cn/2015-09-07/178900940.jpeg\" style=\"margin: 0px; padding: 0px; border: 0px; cursor: pointer;\" width=\"550\" /></div>\n<div align=\"center\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: 宋体; font-size: 14px; line-height: 25.2000007629395px;\">\n	<img align=\"middle\" alt=\"抢到搏击手被打哭 抢劫不成被打得叫爸爸\" border=\"1\" src=\"http://i9.hexunimg.cn/2015-09-07/178900941.jpeg\" style=\"margin: 0px; padding: 0px; border: 0px; cursor: pointer;\" width=\"550\" /></div>\n<div align=\"center\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: 宋体; font-size: 14px; line-height: 25.2000007629395px;\">\n	<div align=\"center\" style=\"margin: 0px; padding: 0px;\">\n		<img align=\"middle\" alt=\"图为制服犯人的女搏击手\" border=\"1\" src=\"http://i2.hexunimg.cn/2015-09-07/178900942.jpeg\" style=\"margin: 0px; padding: 0px; border: 0px; cursor: pointer;\" width=\"550\" /></div>\n</div>\n<p>\n	 </p>\n', null, '/archives\\2014-04-16/1.jpg', null, '抢到搏击手被打哭 抢劫不成被打得叫爸爸', '6', 'http://news.hexun.com/2015-09-07/178900937.html', '2015-09-07', '1', null);
INSERT INTO `weixin_newsitem` VALUES ('7', 'news', '新华网', '<center style=\"color: rgb(51, 51, 51); font-family: \'microsoft yahei\'; font-size: 16px; line-height: 30px;\">\n	<p style=\"margin: 0px 0px 20px; padding: 0px;\">\n		<img alt=\"山大博士后身亡\" src=\"http://img003.21cnimg.com/photos/album/20150907/m600/ED063E3DA5FC148C62FC4F981F100A7B.jpeg\" style=\"border: 0px none; display: inline-block; width: 550px; height: 306px; background-color: rgb(204, 204, 204);\" /></p>\n	<p style=\"margin: 0px 0px 20px; padding: 0px;\">\n		山大博士后身亡</p>\n</center>\n<p style=\"margin: 0px 0px 20px; padding: 0px; color: rgb(51, 51, 51); font-family: \'microsoft yahei\'; font-size: 16px; line-height: 30px; text-align: justify;\">\n	　　前天（5日）晚上11点左右，在山东大学中心校区家属院内发现该校一名博士后男生的尸体，疑因窒息身亡。其邻居称，身亡的博士后<span style=\"font-size: 12px;\">家住五楼，</span><span style=\"font-size: 12px;\">与3名女生一起合租，目前3名女生已搬离出租屋，应该与博士后的死无关。而该博士后尸体被发现时，尸体已僵硬，死状相当恐怖。</span></p>\n<p style=\"margin: 0px 0px 20px; padding: 0px; color: rgb(51, 51, 51); font-family: \'microsoft yahei\'; font-size: 16px; line-height: 30px; text-align: justify;\">\n	　　据了解，身亡的博士后婚情尚不明确，也有消息称，博士后的女友身居外地，两人婚期定在今年农历9月，但未知是否已经领结婚证。又有相关人士猜测，该博士后身亡或与SM(性虐待)有关，但此消息尚未得到有关部门核实。目前，警方已经介入调查，但拒绝就相关案情予以置评。</p>\n', null, '/archives/2014-04-16/3.jpg', null, '山大博士后身亡 生前与3名女子合租', '6', 'http://news.21cn.com/social/shixiang/a/2015/0907/11/29999217.shtml', '2015-09-07', '1', null);
