INSERT INTO `weixin_newsitem` VALUES ('9', 'news', 'admin', '<p>\r\n	<strong style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">小翼：本栏目客户口碑来源于汽车之家官方网站或凯翼客户专访，倾听凯翼车主真实的声音。</strong><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px; color: rgb(229, 51, 51);\"><strong>A、口碑车型：凯翼C3手动金钻版</strong></span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px; color: rgb(229, 51, 51);\"><strong>车主所在城市：武汉洪山</strong></span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【最满意的一点】特地开了一段时间，过了一千公里才来发表口碑，目前感觉满意的不是一点，很多&hellip;&hellip; 综合起来就一点，性价比高！！！&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【最不满意的一点】 对于这个价位，真心不能要求太多，但还是提一点，扶手箱短了点（我好像都没把手放上面过，实在是放着反而不舒服）</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【空间】本人176CM，调好座位，我特地到后排去试了下，有两拳半的距离，头部空间180的坐进来肯定一点压抑感都没有，棒！全车储物空间表现得淋漓尽致，各种储物槽，什么东西都可以找得到地方放。后备箱也还算平整，家用完全足够。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【动力】全国十佳发动机，虽然没什么VVT之类的，但真心很省油，五一期间，车上坐过6个大人，用三档上了个陡坡，动力杠杠的，感觉动力234档都不错，5档还是用来跑高速吧！&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【操控】虽然液压转向，但真的很轻盈，高速和市区操控个人感觉很棒。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【油耗】目前加了500块，跑了1300公里，还剩三格油，新手驾驶哦，非常满意！&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【舒适性】虽然只跑1000来公里，但高速、省道、国道、乡道、山路都跑过，我感觉很满意，烂路走过也没听到什么异响，反正碰到路况不好，有减速带神马的，速度就放慢点过。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【外观】凯翼这外形，个人就觉得红色和蓝的好看，白色也不错，但白的好像太多人买了，而且我车经常停树底下，鸟屎和果粉什么的在白色漆上很明显，也怕发黄。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【内饰】导航、倒车可视、仿皮座椅、副驾还有贴心的化妆镜，全黑的内饰，各个接缝也都很均匀，凯翼车做工确实不错。</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px; color: rgb(229, 51, 51);\"><strong>B、口碑车型：凯翼C3手动金钻版</strong></span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px; color: rgb(229, 51, 51);\"><strong>车主所在城市：无锡</strong></span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【最满意的一点】最满意的地方还是不少的，比如说凯翼C3这车的配置，确实不错，5W多的车子，导航、倒车影像、定速巡航、蓝牙这些配置都有，多功能方向盘用着也非常不错，方向盘手感很好。其次就是这车的操控，方向感很强，底盘扎实，基本上就是指哪打哪。最后说一下这车的油耗，市区7个多一点，高速的话6个上下，已经非常满意了。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【最不满意的一点】倒是谈不上什么最不满意的，没有完美的东西，车子也是一样。内饰里细节方面的做工需要提升一下。 &nbsp;&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【空间】这车前后排的空间都还是是够用的，紧凑型的小车，车内空间感不错了。内饰里面还有好多小的储物空间，实用性也非常的好。后备箱不大不小，日常用足够用的。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【动力】1.5的发动机，这车的动力表现的还算可以吧，五档手动变速箱，提速减速没有顿挫感，非常的顺畅，而且，夏天开空调的时候，对动力也没有太大的影响。总体上说，动力够用的。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【操控】整车的操控还不错，车身扎实，不管是市区还是高速，车身都相当的稳。车厢隔音做的也不错，发动机声音很轻，开起来的那种感觉很好。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【油耗】对这车的油耗也相当的满意，这车还是挺省油的，平时开车的话，这车油耗也就是在7个上下，提车的时候出现过最高的一次油耗，百公里8个，后来慢慢的下降到7个多一点，已经很不错了，高速省油，最好第一次不到6个。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【舒适性】整体的舒适性还不错，一方面来自这车的座椅，包裹性很好，设计的也很贴身，座椅两侧的支撑到位。很舒服，第二就是来自这车的设计，隔音很好，噪音很小，开车关上车窗，里面很安静。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【外观】样子好看，时尚大气，开出去的时候，路上也有人问我，这车什么车，很多人都说这车样子好看。不好看谁会去买啊。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【内饰】整体内饰设计还算不错，多功能方向盘，再有一个液晶屏，看着挺有档次的，不过细看的话，个别的地方塑料感强，要是在提升一下就好了，不过一分钱一分货，也可以了。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【性价比】虽然是一款小车，价格也不高，不过这车配置真的挺好，对于工薪家庭来说，还是相当不错的。配置好，省油，也好开，性价比自然很高。&nbsp;</span><br style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\" />\r\n	<span style=\"color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">【其它描述】之前对国产车的质量没有信心，不过自己想买车的时候，手头资金预算有限，也只能把国产车作为自己的首选，凯翼C3从一开始接触，到后来提车，用车，这段时间表现的都很不错，慢慢，自己也对这车信心十足，至少目前还没有出现过任何的问题。&nbsp;</span></p>\r\n<p style=\"word-wrap: break-word; margin: 5px 0px; color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">\r\n	【为什么最终选择这款车】当时第一眼就被这车的外观吸引了，然后看了这车的配置，竟然有导航，倒车影像，蓝牙，定速巡航等等高级配置，相当中意，空间和油耗也很适合家用，因此果断出手。</p>\r\n<p style=\"word-wrap: break-word; margin: 5px 0px; color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">\r\n	&nbsp;</p>\r\n<p style=\"word-wrap: break-word; margin: 5px 0px; color: rgb(0, 0, 0); font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">\r\n	&nbsp;</p>\r\n', '', '/archives/image/2016043011345220160225082943_4907.jpg', '', '客户口碑', '8', '', '2016-04-30', '2', null);
