INSERT INTO `weixin_wechatnewsitem` VALUES ('1', '4Z0WRW6Q24o1Xs06_aSRXbmF-U1q-HSfwgF_kwx57iw', '习近平到访后的西雅图', '凤凰资讯', '', '<p>\r\n	2015年9月23日，当地时间22日，习近平抵达美国西雅图，开始对美国进行国事访问。而在其乘坐的专机降落到太平洋东岸的这座城市之前，西雅图已经开始忙碌起来：从当地警方发布交通禁行信息，到各个参观点的准备情况，再到当地民众与华人华侨举牌列队欢迎。图为当地华人在列队欢迎。</p>\r\n', '2015年9月23日，当地时间22日，习近平抵达美国西雅图，开始对美国进行国事访问。', '1', '1', '/archives/image/20150923143849W020150923357577397163.jpg', 'https://mmbiz.qlogo.cn/mmbiz/GZ2LIIJazUGicHHWeWichvVA3oYxXPyDBCTASO1AsDzk2kEfoLjsiblqu8wpNYl0a7oIl0MibTZwN12FbJzLj10Hsg/0?wx_fmt=jpeg');
INSERT INTO `weixin_wechatnewsitem` VALUES ('2', '4Z0WRW6Q24o1Xs06_aSRXaQ6TBtFv0Ltd9X5JDrjwG0', '俄罗斯举办原子能工业展 各种', '西物奇瑞1', '', '<p>\n	<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, 宋体; font-size: 14px; line-height: 24px; background-color: rgb(254, 254, 254);\">当地时间2015年9月22日，</span><a class=\"linkAbout\" href=\"http://country.huanqiu.com/russia\" style=\"font-family: Arial, Helvetica, 宋体; font-size: 14px; margin: 0px 5px; padding: 0px 0px 2px; color: rgb(6, 52, 111); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(6, 52, 111); line-height: 24px; background-color: rgb(254, 254, 254);\" target=\"_blank\" title=\"俄罗斯\">俄罗斯</a><span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, 宋体; font-size: 14px; line-height: 24px; background-color: rgb(254, 254, 254);\">莫斯科，</span><a class=\"linkAbout\" href=\"http://country.huanqiu.com/russia\" style=\"font-family: Arial, Helvetica, 宋体; font-size: 14px; margin: 0px 5px; padding: 0px 0px 2px; color: rgb(6, 52, 111); text-decoration: none; border-bottom-width: 1px; border-bottom-style: dotted; border-bottom-color: rgb(6, 52, 111); line-height: 24px; background-color: rgb(254, 254, 254);\" target=\"_blank\" title=\"俄罗斯联邦\">俄罗斯联邦</a><span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, 宋体; font-size: 14px; line-height: 24px; background-color: rgb(254, 254, 254);\">原子能机构公司在Manege中央展览馆举办“70年的原子能工业：成功的连锁反应”展( \"70 Years of the Atomic Industry: A Chain Reaction of Success \")。莫斯科市长谢尔盖·索比亚宁(Sergei Sobyanin)和俄罗斯原子能公司首席执行官谢尔盖·基里延科(Sergei Kiriyenko)到场观展。222</span></p>\n', null, '1', '2', '/archives/image/20150923153831257e82.jpg', 'https://mmbiz.qlogo.cn/mmbiz/GZ2LIIJazUGicHHWeWichvVA3oYxXPyDBCDrvoia6ncPGc9tyU8rCH950fQa18Jlwjw3gXJhdFQ1sAH31fAIPE7VQ/0?wx_fmt=jpeg');
INSERT INTO `weixin_wechatnewsitem` VALUES ('3', '4Z0WRW6Q24o1Xs06_aSRXR5-FFcBpbY9AE33zOEFmC8', '奥地利设计师打造奢华移动岛屿1', '奢华1', '', '<p style=\"margin: 0px; padding: 0px 0px 12px; text-align: left; width: 550px; text-indent: 2em;\">\n	<a style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 24px; text-align: center; background-color: rgb(254, 254, 254);\">豪华游轮已经不能满足世界上的有钱人了，毕竟他们开着这个庞然大物从一个海岛到另一个海岛上辗转还是有很多不方便的地方。</a></p>\n<p>\n	 </p>\n<p style=\"margin: 0px; padding: 0px 0px 12px; width: 550px; text-indent: 2em;\">\n	<a style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 24px; text-align: center; background-color: rgb(254, 254, 254);\">所以设计师们开始想办法造一座人工海岛：可以在世界各地漂移，有80米高的总统套房、有可以启动直升机的升降台、还有瀑布和一个小型港口，让他们可以把自己的游轮带着走。22</a></p>\n', null, '1', '2', '/archives/image/2015092315392285-150923130319.jpg', 'https://mmbiz.qlogo.cn/mmbiz/GZ2LIIJazUGicHHWeWichvVA3oYxXPyDBCbbzvtvpPlLMPq6M1BusJ3WRxqb0UvN444CchWluiatQnICHZa8td25w/0?wx_fmt=jpeg');
INSERT INTO `weixin_wechatnewsitem` VALUES ('5', 'Jqand4uf5XilGclQ3xVw7vGYR7U8EaHBjmU__5WpHuk', '印度恒河污染严重 难载“圣河”美名', '染严重', '', '<p style=\"margin: 0px; padding: 0px 0px 12px; text-align: left; width: 550px; text-indent: 2em;\">\r\n	<a style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 24px; text-align: center; background-color: rgb(254, 254, 254);\">印度阿拉哈巴德，恒河在印度被称为&ldquo;圣河&rdquo;，是印度人崇拜圣浴之地。</a></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px 0px 12px; width: 550px; text-indent: 2em;\">\r\n	<a style=\"color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 24px; text-align: center; background-color: rgb(254, 254, 254);\">但就是这条&ldquo;圣河&rdquo;如今遭到了严重污染，垃圾泛滥，河水浑浊，成了世界污染最严重的河流之一。</a></p>\r\n', '印度阿拉哈巴德，恒河在印度被称为“圣河”，是印度人崇拜圣浴之地。\r\n但就是这条“圣河”如今遭到了严重污染，垃圾泛滥，河水浑浊，成了世界污染最严重的河流之一。', '1', '4', '/archives/image/2015092414301034fae6cd7b899e51f02defa744a7d933c9950de6.jpg', 'https://mmbiz.qlogo.cn/mmbiz/GZ2LIIJazUEULn8yfkvpIxtM91leicn08wu9nx9wz2icicTibc01FngQvTOqwbocDnP55Ssr7SpoBcNLFjohDzxWXg/0?wx_fmt=jpeg');
